21

When Anakin and Mace try to rescue Admiral Kilian from his crashed 
cruiser, they walk into a trap set by Boba Fett and his Bounty Hunter 
associates. Then it is up to R2-D2 to try and get a message out. 

22

Boba Fett and Aurra Sing are using hostages to force Mace Windu to face 
them. With Mace and Anakin still recovering, Plo Koon and Ahsoka Tano 
track down the bounty hunters.

